import React from "react";

export default function Recipe({ recipe }) {
  return (
    <div>
      <div key={recipe.id}>
        <div>{recipe.name}</div>
        <div>
          <button>Edit</button>
          <button>Delete</button>
        </div>

        <div>
          <div>
            <p>Cook Time: {recipe.cookTime}</p>
            <p>Servings: {recipe.servings}</p>
            <p>Instructions: {recipe.Instructions}</p>
          </div>
        </div>
      </div>
      ;
    </div>
  );
}
